const moduleCommands=(()=>{function o(o){Array.from(document.getElementsByClassName(o)).forEach((o=>{o.addEventListener("click",(function(o){switch(this.dataset.command){case"back":history.back();break;case"forward":history.forward();break;case"top":isIE()?window.scrollTo(0):window.scrollTo({top:0,behavior:"smooth"});break;default:}}),!1)}))}return{commandsListener:function(a){o(a)}}})();